from JUMPGAME2.jumpgame2_jonnung import Solution


def test_jumpgame2_default_testcase():
    tc = [2, 3, 1, 1, 4]

    solution = Solution()
    result = solution.jump(tc)

    assert result == 2


def test_jumpgame2_basic1_testcase():
    tc = [0]
    solution = Solution()
    result = solution.jump(tc)

    assert result == 0


def test_jumpgame2_basic2_testcase():
    tc = [1, 2, 3]
    solution = Solution()
    result = solution.jump(tc)

    assert result == 2


def test_jumpgame2_basic3_testcase():
    tc = [3, 2, 1]
    solution = Solution()
    result = solution.jump(tc)

    assert result == 1


def test_jumpgame2_basic4_testcase():
    tc = [1, 2]
    solution = Solution()
    result = solution.jump(tc)

    assert result == 1


def test_jumpgame2_basic5_testcase():
    tc = [1, 2, 0, 1]
    solution = Solution()
    result = solution.jump(tc)

    assert result == 2


